import React from "react";
import '../App.css';

const MovieCard = ({ movie }) => {
    return (
        <div>
            <div className="movie">
                <p>{ movie.Year  }</p>
            </div>

            <img
                src={
                    movie.Poster !== 'N/A'
                        ? movie.Poster
                        : 'https://via.placeholder.com/400'
                }
                alt={movie.Title}
            />

            <div>
                <span>{movie.Type}</span>
                <h3>{movie.Title}</h3>
            </div>
        </div>
    )
}

export default MovieCard;
